import styled from "styled-components";

const Header = () => {
	const Head = styled.div`
		background-color: ${(props) => props.style?.background};
		padding: 25px 30px;
	`;
	const HomeProfile = styled.h1`
		font-size: 1.5em;
		text-align: start;
		color: palevioletred;
		margin: 0;
		float: left;
	`;

	const ProfileAvatar = styled.div`
		text-align: end;
		font-size: 1.5em;
	`;
	return (
		<>
			<Head background="red-bg">
				<HomeProfile>Headers</HomeProfile>
				<ProfileAvatar>P</ProfileAvatar>
			</Head>
		</>
	);
};
export default Header;
